import React, { Component } from 'react';
import styled from 'styled-components'
import AppBody from '../AppBody'
import Column, { AutoColumn } from '../../components/Column'
import {RowBetween} from "../../components/Row";
import SelectDown from '../assets/images/select_down.svg'
import BackIcon from '../../assets/images/back_icon.svg'

const BodyWrapper = styled(AutoColumn)`
  padding-left: 20px;
  padding-right: 20px;
`;
const HeadContainer = styled(RowBetween)`
  background-color: #ffffff;
`;
const BackButton = styled.img`
`;


export default class MoreDAppsComponent extends Component<any, any> {
    search = () => {
        this.props.history.goBack();
    }

    render() {
        return (
            <AppBody>
                <BodyWrapper gap={'md'}>
                    <HeadContainer>
                        {/*<BackButton></BackButton>*/}
                        <img src={BackIcon} alt="" width='9px' height='16px' />
                        <div onClick={this.search}>more</div>

                    </HeadContainer>
                </BodyWrapper>
            </AppBody>
        );
    }
}
